title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o16307.m4 -> o16225.m10 -> o16307.m4
  o16225.m14 -> o16307.m4 -> o16225.m10 -> o16307.m4
  o16307.m3 -> o16225.m21 -> o16307.m4 -> o16225.m10 -> o16307.m4
  o16225.m10 -> o16307.m4 -> o16225.m10
  o16225.m21 -> o16307.m4 -> o16225.m10 -> o16307.m4
  o16225.m19 -> o16307.m4 -> o16225.m10 -> o16307.m4
  o16307.m9 -> o16225.m10 -> o16307.m4 -> o16225.m10

features:
  - inheritance
  - overriding
  - method
  - polymorphism

